"""
### Step 2:  **Import Libraries**


Import the required modules from the `llama_index` and `openai` libraries."""

from llama_index.core import SimpleDirectoryReader, VectorStoreIndex, StorageContext, Document
import PyPDF2
import openai
import kagglehub
import pandas as pd

"""
#### Step 3. **Set Up OpenAI API Key**"""

# Set your OpenAI API key
import os
os.environ["OPENAI_API_KEY"] = "YOUR-API-KEY"

"""### Step 4: **Load Documents from Kaggle**

For this example, let's take a list of documents from kagglehub that we will use for the chatbot. You can load these documents from kaggle hub.
**The dataset contains two types of files: CSV and PDFs**

![Screenshot 2024-12-13 174904.png](data:image/png;base64,)
"""

# Step 1: Download the dataset from Kaggle
path = kagglehub.dataset_download("snehaanbhawal/resume-dataset")
print("Path to dataset files:", path)

"""![Query_Kaggle.gif](data:image/gif;base64,)"""

# Process the CSV file in the 'resume' folder
csv_file_path = os.path.join(path, "Resume", "Resume.csv")
csv_data = pd.read_csv(csv_file_path)

# Limit to the first 3 rows of the CSV
limited_csv_data = csv_data.head(3)

csv_documents = []
for _, row in limited_csv_data.iterrows():
    text = f"ID: {row['ID']}\nCategory: {row['Category']}\nResume:\n{row['Resume_str']}"
    csv_documents.append(Document(text=text))

print(f"Processed {len(csv_documents)} documents from the CSV file.")

# Step 3: Process a limited number of PDFs in the 'data' folder
pdf_documents = []
data_folder = os.path.join(path, "data")
pdf_limit = 1  # Limit to 3 PDFs

pdf_count = 0
for category_folder in os.listdir(data_folder):
    category_path = os.path.join(data_folder, category_folder)
    if os.path.isdir(category_path):
        for file in os.listdir(category_path):
            if file.endswith(".pdf"):
                pdf_path = os.path.join(category_path, file)
                try:
                    # Extract text from the first 5 pages of each PDF
                    with open(pdf_path, "rb") as pdf_file:
                        pdf_reader = PyPDF2.PdfReader(pdf_file)
                        text = ""
                        for page_num, page in enumerate(pdf_reader.pages):
                            if page_num >= 1:
                                break
                            text += page.extract_text()
                    pdf_documents.append(Document(text=f"Category: {category_folder}\n{text}"))
                    pdf_count += 1
                except Exception as e:
                    print(f"Error reading {file}: {e}")
                # Break once we reach the limit
                if pdf_count >= pdf_limit:
                    break
        if pdf_count >= pdf_limit:
            break

print(f"Processed {len(pdf_documents)} PDF documents from the 'data' folder.")

# Step 4: Combine all documents
all_documents = csv_documents + pdf_documents

"""
#### Step 5. **Create an Index**

Create a `VectorStoreIndex` from the documents. This index will be used to query information during conversations."""

# Step 5: Create an index from all documents
index = VectorStoreIndex.from_documents(all_documents)

"""
#### Step 6. **Query the Index with LLM**

Use the index to query information, and process the query with an LLM to generate a response."""

# Function to query the index and generate a response using LLM
def query_with_llm(query):
    # Invoke as_query_engine() to get a query engine
    query_engine = index.as_query_engine()
    # Now you can query using the query engine
    index_response = query_engine.query(query)

    # Use LLM to generate a response
    llm_response = openai.chat.completions.create(
        model="gpt-4o",
        messages=[{"role": "user", "content": f"Based on the following information: {index_response}, answer the question: {query}"}],
        max_tokens=150
    )

    return llm_response.choices[0].message.content.strip()

# Example query
response = query_with_llm("What are the key skills for an IT professional?")
print(response)

